import styled from 'styled-components';

export const Loading = styled.div`

  color: #fff;
  font-size: 30px;
  font-weight: bold;
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  
`;

export const Owner = styled.header`

  display: flex;
  
  align-items: center;

  img {
    border-radius: 100%;
  }

`;
